def dense_to_one_hot(labels_dense,num_classes=2):
    num_labels = labels_dense.shape[0]
    labels_one_hot = zeros((num_labels,num_classes))
    index = 0
    for i in range(num_labels):
        if labels_dense[i] == 0:
            index = 0
        else:
            index=1
        labels_one_hot[i][index] = 1
    return labels_one_hot


